import React from 'react';
import Button from './button';
import headerButtons from '../data/headerButtons';

function Header() {
  const buttonsList = headerButtons;

  return (
    <nav>
      { buttonsList.map(btn => <Button buttonName={btn} />) }
    </nav>
  );
}

export default Header;
